import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './utils/serviceWorker';
import lang from './lang.json';

ReactDOM.render(<App />, document.getElementById('root'));
serviceWorker.unregister();
